import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

export default function SelectCategory() {
    const [name, setName] = useState("");
    const [pref, setPref] = useState({ 'categories': [] });
    const [seain, setSeain] = useState("");
    const [checkedOptions, setCheckedOptions] = useState<string[]>([]);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchData = async () => {
            const storedName = sessionStorage.getItem("email") || "";
            setName(storedName);
            if (storedName === "") {
                navigate('/login');
                return;
            }

            try {
                const responsePref = await fetch('http://127.0.0.1:5000/get_all_pref');
                const bodyPref = await responsePref.json();
                setPref(bodyPref);

                const responseCategories = await fetch('http://127.0.0.1:5000/get_all_categories');
                const bodyCategories = await responseCategories.json();
                // Do something with bodyCategories if needed
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();

    }, [navigate]);

    const search = async () => {
        try {
            const response = await fetch('http://127.0.0.1:5000/search', {
                method: 'POST',
                headers: {
                    'content-type': 'application/json',
                },
                body: JSON.stringify({
                    "name": seain
                }),
            });
            const body = await response.json();
            // Handle response data if needed
        } catch (error) {
            console.error('Error searching:', error);
        }
    };

    const handleCheckboxChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        const { value, checked } = event.target;

        setCheckedOptions(prevCheckedOptions => {
            if (checked) {
                return [...prevCheckedOptions, value];
            } else {
                return prevCheckedOptions.filter(option => option !== value);
            }
        });
    };

    const submit = async () => {
        navigate('/hotcategories');
        try {
            const response = await fetch('http://127.0.0.1:5000/prefset', {
                method: 'POST',
                headers: {
                    'content-type': 'application/json',
                },
                body: JSON.stringify({
                    "username": name,
                    "pref": checkedOptions,
                }),
            });
            const body = await response.json();
            // Handle response body if needed
        } catch (error) {
            console.error('Error submitting:', error);
        }
    };

    const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        setSeain(e.target.value);
    };

    return (
      <>
        
      <div className='categorySelection' >

      <div className='nav'>
      <p className='labelh' >Product Scout</p>
      <div className='nav-cont' >
          <div>
              <div className="search-containerh">
                  <i className="search-icon fas fa-search"></i>
                  <input
                      className="search-inputh"
                      type="text"
                      placeholder="Article name or keywords..."
                      onChange={seat}
                      value={seain}
                  />
              </div>
              <div>
              {/* <div className="dropdown">
                  <button onClick={toggleDropdown} className="dropdown-btn">
                      All Categories <i className="dropicon fas fa-chevron-down"></i>
                  </button>
                  {isOpen && (
                      <div className="dropdown-content">
                        
                        {
                        cat['categories'].map((number) => (
                          <li key={number}>
                            <a >{number}</a>
                          </li>
                        ))
                      } 

                      </div>
                  )}
                  </div> */}
                  
              </div>
              <button className='Searchbut' onClick={search}>
                      Search
              </button>

              <button className='cati' onClick={() => { navigate("/select-category") }}>
                      Home
              </button>

              <button className='logouts' onClick={() => { navigate("/") }}>
                      Logout
              </button>
              <button className='trends' onClick={() => { navigate("/hotcategoreis") }}>
                      Hot Products
              </button>

              <button className='calculator' onClick={() => { navigate("/calculator") }}>
                      Profit Calculator
              </button>
          </div>
        
        
      </div>
    </div>
              <div >
                  {/* <img className='a2' src={doc3} /> */}
                  <img className='a11' src={doc2} alt='ima'/>
                  <h1 className='a5'>Please select your Preferred Categories</h1>
                  <form className='forms'>
                      {pref['categories'].map((option, index) => (
                          <div key={index}>
                              <input
                                  type="checkbox"
                                  id={option}
                                  value={option}
                                  onChange={handleCheckboxChange}
                              />
                              <label className='labelf' htmlFor={option}>{option}</label>
                          </div>
                      ))}
                      <button onClick={() => { submit() }} className='subpref' >Submit</button>
                  </form>
              </div>
          </div>

  
      </>
    );
}
